import Home from './Home';
import Searchbar from './Searchbar';

function App() {
  return (
    <div className='App'>
      <div className='grid  mt-16 mx-10 font-Roboto-Mono'>
        <Searchbar />
        <Home />
      </div>
    </div>
  );
}

export default App;
